// SignInForm.js
import React from 'react';

const SignInForm = () => {
  const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;

  const handleSignIn = (e) => {
    e.preventDefault();
    const emailInput = e.target.elements.email.value;
    const passwordInput = e.target.elements.password.value;

    // Validate email using regex
    if (!emailRegex.test(emailInput)) {
      alert('Please enter a valid email address.');
      return;
    }

    // Other validation logic as needed

    // Perform sign-in logic
    console.log('Sign In:', { email: emailInput, password: passwordInput });
  };

  return (
    <form onSubmit={handleSignIn} className="needs-validation" noValidate>
      <div className="form-group">
        <label htmlFor="email">Email:</label>
        <input type="email" className="form-control0" id="email" required />
        <div className="invalid-feedback">Please enter a valid email address.</div>
      </div>
      <div className="form-group0">
        <label htmlFor="password">Password:</label>
        <input type="password" className="form-control" id="password" required />
        <div className="invalid-feedback">Please enter a password.</div>
      </div>
      <button type="submit" className="btn btn-primary">Sign In</button>
    </form>
  );
};

export default SignInForm;
